import React, { useState } from 'react'; 


const Example = () => {
  const [count, setCount] = useState(0); 
  const test = () => count  + 1
  return (
    <div>
      <p>Vous avez cliqué {count} fois</p>
      <button onClick={() => setCount(count + 1)}>
          Cliquez ici
     </button>
     <button onClick={() => setCount(0)}>
          Remettre à Zéro
     </button>
    </div>
  );
}

export default Example;
